$templateCache.put("views/charts.html","<!-- start: PAGE TITLE -->\r\n<section id=\"page-title\">\r\n	<div class=\"row\">\r\n		<div class=\"col-sm-8\">\r\n			<h1 class=\"mainTitle\" translate=\"sidebar.nav.charts.MAIN\">Charts</h1>\r\n			<span class=\"mainDescription\">Tc-angular-chartjs provides you with directives for all chartjs chart types.</span>\r\n		</div>\r\n		<div ncy-breadcrumb></div>\r\n	</div>\r\n</section>\r\n<!-- end: PAGE TITLE -->\r\n<!-- start: LINE CHART -->\r\n<div class=\"container-fluid container-fullw bg-white\">\r\n	<div class=\"row\">\r\n		<div class=\"col-sm-12\">\r\n			<h5 class=\"over-title margin-bottom-15\">Line <span class=\"text-bold\">Chart</span></h5>\r\n			<div class=\"row\">\r\n				<!-- /// controller:  \'ChartCtrl1\' -  localtion: js/controllers/chartsCtrl.js /// -->\r\n				<div ng-controller=\"ChartCtrl1\">\r\n					<div class=\"col-sm-6\">\r\n						<canvas class=\"tc-chart\" tc-chartjs-line chart-options=\"options\" chart-data=\"data\" chart-legend=\"lineChart1\"></canvas>\r\n					</div>\r\n					<div class=\"col-sm-6\">\r\n						<p class=\"margin-bottom-20\">\r\n							A line chart is a way of plotting data points on a line.\r\n							Often, it is used to show trend data, and the comparison of two data sets.\r\n						</p>\r\n						<p>\r\n							The line chart requires an array of labels for each of the data points. This is shown on the X axis. The data for line charts is broken up into an array of datasets. Each dataset has a colour for the fill, a colour for the line and colours for the points and strokes of the points. These colours are strings just like CSS. You can use RGBA, RGB, HEX or HSL notation.\r\n						</p>\r\n						<p>\r\n							The label key on each dataset is optional, and can be used when generating a scale for the chart.\r\n						</p>\r\n						<p class=\"margin-top-20\">\r\n							<div tc-chartjs-legend chart-legend=\"lineChart1\"></div>\r\n						</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<!-- end: LINE CHART -->\r\n<!-- start: BAR CHART -->\r\n<div class=\"container-fluid container-fullw\">\r\n	<div class=\"row\">\r\n		<div class=\"col-sm-12\">\r\n			<h5 class=\"over-title margin-bottom-15\">Bar <span class=\"text-bold\">Chart</span></h5>\r\n			<div class=\"row\">\r\n				<!-- /// controller:  \'ChartCtrl2\' -  localtion: js/controllers/chartsCtrl.js /// -->\r\n				<div ng-controller=\"ChartCtrl2\">\r\n					<div class=\"col-sm-6\">\r\n						<p class=\"margin-bottom-20\">\r\n							A bar chart is a way of showing data as bars.\r\n							It is sometimes used to show trend data, and the comparison of multiple data sets side by side.\r\n						</p>\r\n						<p>\r\n							The bar chart has the a very similar data structure to the line chart, and has an array of datasets, each with colours and an array of data. Again, colours are in CSS format.\r\n							We have an array of labels too for display. In the example, we are showing the same data as the previous line chart example.\r\n						</p>\r\n						<p>\r\n							The label key on each dataset is optional, and can be used when generating a scale for the chart.\r\n						</p>\r\n						<p class=\"margin-top-20\">\r\n							<div tc-chartjs-legend chart-legend=\"lineChart2\"></div>\r\n						</p>\r\n					</div>\r\n					<div class=\"col-sm-6\">\r\n						<canvas class=\"tc-chart\" tc-chartjs-bar chart-options=\"options\" chart-data=\"data\" chart-legend=\"lineChart2\"></canvas>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<!-- end: BAR CHART -->\r\n<!-- start: DOUGHNUT CHART -->\r\n<div class=\"container-fluid container-fullw bg-white\">\r\n	<div class=\"row\">\r\n		<div class=\"col-sm-12\">\r\n			<h5 class=\"over-title margin-bottom-15\">Doughnut <span class=\"text-bold\">Chart</span></h5>\r\n			<div class=\"row\">\r\n				<!-- /// controller:  \'ChartCtrl3\' -  localtion: js/controllers/chartsCtrl.js /// -->\r\n				<div ng-controller=\"ChartCtrl3\">\r\n					<div class=\"col-sm-6\">\r\n						<div class=\"text-center margin-bottom-15\">\r\n							<canvas class=\"tc-chart\" tc-chartjs-doughnut chart-options=\"options\" chart-data=\"data\" chart-legend=\"lineChart3\" width=\"250\"></canvas>\r\n						</div>\r\n					</div>\r\n					<div class=\"col-sm-6\">\r\n						<p>\r\n							Pie and doughnut charts are probably the most commonly used chart there are. They are divided into segments, the arc of each segment shows the proportional value of each piece of data.\r\n						</p>\r\n						<p>\r\n							They are excellent at showing the relational proportions between data.\r\n						</p>\r\n						<p>\r\n							Pie and doughnut charts are effectively the same class in Chart.js, but have one different default value - their <code>percentageInnerCutout</code>. This equates what percentage of the inner should be cut out. This defaults to <code>0</code> for pie charts, and <code>50</code> for doughnuts.\r\n						</p>\r\n						<p class=\"margin-top-20\">\r\n							<div tc-chartjs-legend chart-legend=\"lineChart3\"></div>\r\n						</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<!-- end: DOUGHNUT CHART -->\r\n<!-- start: PIE CHART -->\r\n<div class=\"container-fluid container-fullw\">\r\n	<div class=\"row\">\r\n		<div class=\"col-sm-12\">\r\n			<h5 class=\"over-title margin-bottom-15\">Pie <span class=\"text-bold\">Chart</span></h5>\r\n			<div class=\"row\">\r\n				<!-- /// controller:  \'ChartCtrl4\' -  localtion: js/controllers/chartsCtrl.js /// -->\r\n				<div ng-controller=\"ChartCtrl4\">\r\n					<div class=\"col-sm-6\">\r\n						<p>\r\n							Pie and doughnut charts are probably the most commonly used chart there are. They are divided into segments, the arc of each segment shows the proportional value of each piece of data.\r\n						</p>\r\n						<p>\r\n							They are excellent at showing the relational proportions between data.\r\n						</p>\r\n						<p>\r\n							Pie and doughnut charts are effectively the same class in Chart.js, but have one different default value - their <code>percentageInnerCutout</code>. This equates what percentage of the inner should be cut out. This defaults to <code>0</code> for pie charts, and <code>50</code> for doughnuts.\r\n						</p>\r\n						<p class=\"margin-top-20\">\r\n							<div tc-chartjs-legend chart-legend=\"lineChart4\"></div>\r\n						</p>\r\n					</div>\r\n					<div class=\"col-sm-6\">\r\n						<div class=\"text-center margin-bottom-15\">\r\n							<canvas class=\"tc-chart\" tc-chartjs-pie chart-options=\"options\" chart-data=\"data\" chart-legend=\"lineChart4\" width=\"250\"></canvas>\r\n						</div>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<!-- end: PIE CHART -->\r\n<!-- start: POLAR AREA CHART -->\r\n<div class=\"container-fluid container-fullw bg-white\">\r\n	<div class=\"row\">\r\n		<div class=\"col-sm-12\">\r\n			<h5 class=\"over-title margin-bottom-15\">Polar Area <span class=\"text-bold\">Chart</span></h5>\r\n			<div class=\"row\">\r\n				<!-- /// controller:  \'ChartCtrl5\' -  localtion: js/controllers/chartsCtrl.js /// -->\r\n				<div ng-controller=\"ChartCtrl5\">\r\n					<div class=\"col-sm-6\">\r\n						<div class=\"text-center margin-bottom-15\">\r\n							<canvas class=\"tc-chart\" tc-chartjs-polararea chart-options=\"options\" chart-data=\"data\" chart-legend=\"lineChart5\" width=\"250\"></canvas>\r\n						</div>\r\n					</div>\r\n					<div class=\"col-sm-6\">\r\n						<p>\r\n							Polar area charts are similar to pie charts, but each segment has the same angle - the radius of the segment differs depending on the value.\r\n						</p>\r\n						<p>\r\n							This type of chart is often useful when we want to show a comparison data similar to a pie chart, but also show a scale of values for context.\r\n						</p>\r\n						<p>\r\n							As you can see, for the chart data you pass in an array of objects, with a value and a colour. The value attribute should be a number, while the color attribute should be a string. Similar to CSS, for this string you can use HEX notation, RGB, RGBA or HSL.\r\n						</p>\r\n						<p class=\"margin-top-20\">\r\n							<div tc-chartjs-legend chart-legend=\"lineChart5\"></div>\r\n						</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<!-- end: POLAR AREA CHART -->\r\n<!-- start: RADAR CHART -->\r\n<div class=\"container-fluid container-fullw\">\r\n	<div class=\"row\">\r\n		<div class=\"col-sm-12\">\r\n			<h5 class=\"over-title margin-bottom-15\">Radar <span class=\"text-bold\">Chart</span></h5>\r\n			<div class=\"row\">\r\n				<!-- /// controller:  \'ChartCtrl6\' -  localtion: js/controllers/chartsCtrl.js /// -->\r\n				<div ng-controller=\"ChartCtrl6\">\r\n					<div class=\"col-sm-6\">\r\n						<p>\r\n							A radar chart is a way of showing multiple data points and the variation between them.\r\n						</p>\r\n						<p>\r\n							They are often useful for comparing the points of two or more different data sets.\r\n						</p>\r\n						<p>\r\n							For a radar chart, to provide context of what each point means, we include an array of strings that show around each point in the chart.\r\n							For the radar chart data, we have an array of datasets. Each of these is an object, with a fill colour, a stroke colour, a colour for the fill of each point, and a colour for the stroke of each point. We also have an array of data values.\r\n						</p>\r\n						<p class=\"margin-top-20\">\r\n							<div tc-chartjs-legend chart-legend=\"lineChart6\"></div>\r\n						</p>\r\n					</div>\r\n					<div class=\"col-sm-6\">\r\n						<canvas class=\"tc-chart\" tc-chartjs-radar chart-options=\"options\" chart-data=\"data\" chart-legend=\"lineChart6\"></canvas>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<!-- end: RADAR CHART -->\r\n");
